import React, { Component } from 'react';

class HogwartsCards extends Component {
    constructor() {
        super();
        this.state = {}
    }
    render() {
        let deck = this.props.HogwartsCards;
        let liveCards = []
        for(let i = 0; i < 5; i++){
            liveCards.push(this.props.hogwartsCards[0])
            deck.unshift(0)
        }
        console.log(deck);
        console.log(liveCards);
        return (
            <div>
                {liveCards.map((card) => <li>{card.name}</li> )}
            </div>
        )
    };
}

export default HogwartsCards;
